// 千分位
function formatNum(strNum) {
    if (Math.round(strNum) <= 10 && strNum.length <= 3) {
        return strNum;
    }
    u0 = 0
    while (Math.round(strNum) > 1000000 && u0 < 3) {
        strNum = Math.round(Math.round(strNum) / 10000);
        u0 = u0 + 1
    }

    if (!/^(\+|-)?(\d+)(\.\d+)?$/.test(strNum)) {
        return strNum;
    }
    var a = RegExp.$1,
        b = RegExp.$2,
        c = RegExp.$3;
    var re = new RegExp();
    re.compile("(\\d)(\\d{3})(,|$)");
    while (re.test(b)) {
        b = b.replace(re, "$1,$2$3");
    }
    return a + "" + b + "" + c + unit[String(u0)];
}
